window.bookSummaryJSON = "<p><b>Ryan \"Quicksave\" Romano is an eccentric adventurer with a strange power: he can create a save-point in time and redo his life whenever he dies. </b></p> <p>Arriving in New Rome, the glitzy capital of sin of a rebuilding Europe, he finds the city torn between mega-corporations, sponsored heroes, super-powered criminals, and true monsters. It's a time of chaos, where potions can grant the power to rule the world and dangers lurk everywhere.</p> <p>Ryan sees many different routes, and from Hero to Villain, he has to try them all. Only then will he achieve his perfect ending...no matter how many loops it takes.</p>"; 
